const max = {
  "deaths": 5000,
  "cumulativeDeaths": 62698,
  "confirmed": 38509,
  "cumulativeConfirmed": 1171185
} 

const DATE = '2020-05-05'
const TYPE = 'confirmed'

const dailyData = data[DATE]
console.log(dailyData)

let table = []
let iso2cds = []
for (let iso2cd in dailyData) {
  iso2cds.push(iso2cd)
  const g = 
    dailyData[iso2cd][TYPE] / 
    max[TYPE]
  if (table[g]) {
    table[g].push(iso2cd)
  } else {
    table[g] = [iso2cd]
  }
}
let fillExpression = [
  'match',
  [
    'get',
    'iso2cd'
  ]
]
for (let g in table) {
  fillExpression.push(table[g])
  fillExpression.push('hsl(' + parseInt(60 - g * 60) + ', 100%, 50%)')
}
fillExpression.push([
  'rgb',
  250,
  250,
  250
])

const map = new mapboxgl.Map({
  container: 'map',
  style: 'https://tabularmaps.github.io/8bit-tile/style.json',
  attributionControl: true,
  hash: true,
  renderWorldCopies: false
})
map.addControl(new mapboxgl.NavigationControl())

let match1 = [
  'match',
  [
    'get',
    'iso2cd'
  ]
]
let match2 = [
  'match',
  [
    'get',
    'iso2cd'
  ]
]
let match3 = [
  'match',
  [
    'get',
    'iso2cd'
  ]
]
for (let iso2cd in dailyData) {
  match1.push(iso2cd)
  match1.push(dailyData[iso2cd]['confirmed'].toString())
  match2.push(iso2cd)
  match2.push([
    'concat',
    [
      'get',
      'iso3cd'
    ],
    ': ',
    dailyData[iso2cd][TYPE]
  ])
  match3.push(iso2cd)
  match3.push([
    'concat',
    [
      'get',
      'maplab'
    ],
    ': ',
    dailyData[iso2cd][TYPE],
    ' ',
    TYPE
  ])
}
match1.push('?')
match2.push('?')
match3.push('?')

const textFieldExpression = [
  'step',
  [
    'zoom'
  ],
  match1,
  2,
  match2,
  4,
  match3
]

const fillExtrusionHeight = [
  'match',
  [
    'get',
    'iso2cd'
  ]
]
for (let iso2cd in dailyData) {
  fillExtrusionHeight.push([iso2cd])
  fillExtrusionHeight.push(dailyData[iso2cd][TYPE] * 100)
}
fillExtrusionHeight.push(0)
console.log(fillExtrusionHeight)

map.on('load', () => {
  map.getSource('v').attribution += 
    ` | number of ${TYPE} on ${DATE} from WHO`
  console.log(map.getSource('v').attribution)
  map.setPaintProperty(
    'bnda',
    'fill-color',
    fillExpression
  )
  map.setLayoutProperty(
    'text',
    'text-field',
    textFieldExpression
  )
  map.setPaintProperty(
    'text',
    'text-color',
    [
      'match',
      [
        'get',
        'iso2cd'
      ],
      iso2cds,
      [
        'rgb',
        0,
        0,
        0
      ],
      [
        'rgb',
        250,
        250,
        250
      ]
    ]
  )
  map.addLayer({
    id: 'bnda-extrusion',
    source: 'v',
    'source-layer': 'bnda',
    type: 'fill-extrusion',
    paint: {
      'fill-extrusion-height': fillExtrusionHeight,
      'fill-extrusion-color': fillExpression,
      'fill-extrusion-opacity': 0.2
    } 
  })
})
